import React from "react";
import Post from "./Post/Post";
import { useSelector } from "react-redux";


const Posts = () => {

     const posts = useSelector((state) => state.posts.posts);

    return (
        <div>
            
            {
                posts.map(
                    post => {
                        return <div> <Post post={post}/></div>
                    }
                )
            }
        </div>
    )
}

export default Posts;
